threaded C++ application:

// Include necessary headers
#include <iostream>
#include <thread>

int main() {
    std::cout << "Launching threads..." << std::endl;

// Create threads
    std::thread t1([]() { std::cout << "Running thread 1" << std::endl; });
    std::thread t2([]() { std::cout << "Running thread 2" << std::endl; });

    // Detach Threads
    t1.detach();
    t2.detach();

    std::cout << "Main thread is ending" << std::endl;
